import Layout from '../components/Layout';
import Link from 'next/link';

const PostLink = (props) => (
    <li>
        <Link href={`/post?title=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
);

const Index = () => (
    <Layout>
        <p>Hello next.js</p>
    </Layout>
);

export default Index;
